import "./rightbar.css"

export default function Rightbar({profile}) {
  const HomeRightBar= ()=> {
    return (
      <>
      <img src="assets/ad.png" className="rightbarAd " alt="" /> 
      </>
    )
  }
  const ProfileRightBar = () =>{
    return(<h1>hey it is profile</h1>)
  }
  return (
    <div className="rightbar">
      <div className="rightbarWrapper">
          <ProfileRightBar/>
      </div>
    </div>
  )
}
